import { Container, Switch } from "@material-ui/core";
import {BrowserRouter, Route} from "react-router-dom";
import "./App.css";
import Header from './components/Header';
import SimpleBottomNavigation from "./components/MainNav";
import Movies from "./pages/Movies/Movies";
import Series from "./pages/Movies/Series";
import Search from "./pages/Movies/Series/Search";
import Trending from "./pages/Movies/Series/Trending/Trending";

function App() {
  return (
    <BrowserRouter>
      <Header />
      <div className='app'>
        <Container>
          <Switch>
            <Route path='/' components={Trending} exact/>
            <Route path='/Movies' components={Movies}/>
            <Route path='/Series' components={Series}/>
            <Route path='/Search' components={Search}/>           
          </Switch>
        </Container>
      </div>




      <SimpleBottomNavigation/>
      </BrowserRouter>
  );
}

export default App;
